

CREATE TABLE `admins` (
  `admin_id` int(10) NOT NULL AUTO_INCREMENT,
  `admin_username` varchar(20) NOT NULL,
  `admin_password` varchar(200) NOT NULL,
  PRIMARY KEY (`admin_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;

INSERT INTO admins VALUES('1','admin','$2y$10$p8lnanYuzY3bkNzp46v/UeARXp.re1/6Uyf82fE5gSI4kD7iSWW5S');


CREATE TABLE `loan_bank` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `amount` int(11) NOT NULL,
  `last_updated` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;

INSERT INTO loan_bank VALUES('1','0','2023-05-12 18:44:01');


CREATE TABLE `loan_due_dates` (
  `id` int(30) NOT NULL AUTO_INCREMENT,
  `due_order` int(30) NOT NULL,
  `loan_ref_no` int(30) NOT NULL,
  `due_date` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=935 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `loan_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL,
  `loan_id` int(11) NOT NULL,
  `debit` float NOT NULL,
  `credit` float NOT NULL,
  `description` varchar(30) NOT NULL,
  `date` datetime NOT NULL,
  `ref_no` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `loan_list` (
  `id` int(30) NOT NULL AUTO_INCREMENT,
  `borrower_id` int(30) NOT NULL,
  `ref_no` int(50) NOT NULL,
  `loan_plan` int(30) NOT NULL,
  `amount` double NOT NULL,
  `status` tinyint(1) NOT NULL,
  `current_due_order` int(11) NOT NULL,
  `date_created` datetime NOT NULL,
  `date_released` datetime NOT NULL,
  `comment` text NOT NULL,
  `attachment` mediumblob NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=202 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `loan_payments` (
  `id` int(30) NOT NULL AUTO_INCREMENT,
  `payment_ref_no` int(11) NOT NULL,
  `loan_ref_no` int(30) NOT NULL,
  `payee` varchar(30) NOT NULL,
  `amount` int(30) NOT NULL DEFAULT 0,
  `penalty` int(30) NOT NULL DEFAULT 0,
  `overdue` tinyint(4) NOT NULL,
  `date_created` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=214 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `loan_plan` (
  `id` int(30) NOT NULL AUTO_INCREMENT,
  `plan_name` varchar(30) NOT NULL,
  `months` int(10) NOT NULL,
  `interest_percentage` float NOT NULL,
  `penalty_rate` int(11) NOT NULL,
  `payment_frequency` int(11) NOT NULL COMMENT 'How many payments per month.',
  `repayment_method` int(11) NOT NULL COMMENT 'The loan payment SYSTEM or Method.',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `members` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL,
  `firstname` varchar(20) NOT NULL,
  `middlename` varchar(30) NOT NULL,
  `lastname` varchar(30) NOT NULL,
  `age` int(11) NOT NULL,
  `gender` varchar(11) NOT NULL,
  `mobile_number` text NOT NULL,
  `province` varchar(30) NOT NULL,
  `city` varchar(30) NOT NULL,
  `barangay` varchar(30) DEFAULT NULL,
  `land_area` int(30) NOT NULL,
  `status` tinyint(1) NOT NULL,
  `date_registered` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `savings_account_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `account_holder_id` int(11) NOT NULL,
  `account_number` int(20) NOT NULL,
  `account_balance` double NOT NULL,
  `interest_rate` int(11) NOT NULL,
  `earnings_balance` double NOT NULL,
  `date_created` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `savings_bank` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `amount` int(11) NOT NULL,
  `last_updated` datetime NOT NULL,
  `last_interest_crediting_date` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;

INSERT INTO savings_bank VALUES('1','0','2023-05-16 03:34:20','2023-05-12');


CREATE TABLE `savings_deposit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ref_no` int(11) NOT NULL,
  `account_number` int(11) NOT NULL,
  `account_holder` int(11) NOT NULL,
  `deposit_amount` int(11) NOT NULL,
  `deposit_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `savings_earnings_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ref_no` int(20) NOT NULL,
  `account_number` int(20) NOT NULL,
  `account_holder` varchar(50) NOT NULL,
  `withdraw_amount` float NOT NULL,
  `withdraw_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `savings_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL,
  `account_number` int(11) NOT NULL,
  `debit` float NOT NULL,
  `credit` float NOT NULL,
  `description` varchar(30) NOT NULL,
  `date` datetime NOT NULL,
  `ref_no` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=604 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `savings_interest_earnings` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `account_number` int(20) NOT NULL,
  `date` datetime NOT NULL,
  `ref_no` int(20) NOT NULL,
  `amount` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8771 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `savings_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ref_no` int(11) NOT NULL,
  `account_number` int(11) NOT NULL,
  `account_holder` varchar(30) NOT NULL,
  `withdraw_amount` int(11) NOT NULL,
  `withdraw_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `settings` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL,
  `logo` mediumblob NOT NULL,
  `theme` int(11) NOT NULL,
  `date_range_start` date DEFAULT NULL,
  `date_range_end` date DEFAULT NULL,
  `date_range_id` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4;

